import React from "react";
import "./boxExamples.css";

export default function BoxExamples() {
  return (
    <div className="container">
      <div className="row">
        <div className="example col-lg-4 col-sm-6 box-1"></div>
        <div className="example col-lg-4 col-sm-6 box-2"></div>
        <div className="example col-lg-4 col-sm-6 box-3"></div>
        <div className="example col-lg-4 col-sm-6 box-4"></div>
        <div className="example col-lg-4 col-sm-6 box-5"></div>
        <div className="example col-lg-4 col-sm-6 box-6"></div>
        <div className="example col-lg-4 col-sm-6 box-7"></div>
        <div className="example col-lg-4 col-sm-6 box-8"></div>
      </div>
    </div>
  );
}
